import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import AshaWorkerLogin from "./components/auth/AshaWorkerLogin";
import AshaWorkerSignup from "./components/auth/AshaWorkerSignup";
import AshaWorkerDashboard from "./components/dashboard/AshaWorkerDashboard";
import Navbar from "./components/layout/Navbar";
import "./styles/global/App.css";
import Services from "./Services";
import MEDICONNECTChatbot from "./Chatbot"; 
import Preloader from "./Preloader"; 
import HomePage from './pages/Home/index.jsx'; 
import RoomPage from './pages/Home/Room/index.jsx'; 
import FacialAuth from './components/FacialAuth.js'; // Fixed capitalization in import
import CameraTester from './CameraTester'; // Add CameraTester to imports
import testDatabaseConnection from './services/testFirebaseConnection';

function App() {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Test Firebase connectivity on startup
    const checkFirebase = async () => {
      try {
        // Skip test in production
        if (process.env.NODE_ENV !== 'production') {
          console.log("🔍 Testing Firebase connection...");
          const result = await testDatabaseConnection();
          console.log("Firebase connection test result:", result);
        }
      } catch (err) {
        console.error("Firebase connection test error:", err);
      }
    };
    
    checkFirebase();
    
    const hasSeenPreloader = localStorage.getItem('hasSeenPreloader');

    if (!hasSeenPreloader) {
      
      const timer = setTimeout(() => {
        setLoading(false);
        
        localStorage.setItem('hasSeenPreloader', 'true');
      }, 5000); 

      
      return () => clearTimeout(timer);
    } else {
      
      setLoading(false);
    }
  }, []);

  return (
      <Router>
        {loading ? (
          <Preloader />
        ) : (
          <div>
            <Navbar />
            <div className="content-wrapper">
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/about" element={<About />} />
                <Route path="/services" element={<Services />} />
                <Route path="/chatbot" element={<MEDICONNECTChatbot />} />
                <Route path="/login" element={<Login />} />
                <Route path="/signup" element={<Signup />} />
                <Route path="/video-conferencing" element={<HomePage />} />
                <Route path="/room/:roomId" element={<RoomPage />} />
                <Route path="/asha-login" element={<AshaWorkerLogin />} /> 
                <Route path="/asha-signup" element={<AshaWorkerSignup />} /> 
                <Route path="/asha-dashboard" element={<AshaDashboard />} /> 
                <Route path="/facial-auth" element={<FacialAuth />} />
                <Route path="/camera-test" element={<CameraTester />} />
              </Routes>
            </div>
          </div>
        )}
      </Router>
  );
}

export default App;
